
public class Q7 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x =10;
		int y =20;
		System.out.println("Before swaping the value");
		System.out.println(x);
		System.out.println(y);
		
		int z=x;
		x=y;
		y=z;
		System.out.println("After swaping the value");
		System.out.println(x);
		System.out.println(y);
	}

}
